import React, { Component } from 'react';
import HeaderNavbar from './HeaderNavbar'
import UserService from './service/UserService'
import Grid from '@mui/material/Grid';
import { resolveResponse } from "./utils/ResponseHandler";
class Homepage extends Component {
    constructor(props) {
        super(props);

        this.state = {
            categoryList: []
        }
    }


    componentDidMount() {

        var data = { allPacks: true, portal: true };
        UserService.getCategory(data)
            .then((res) => {
                //   let data = resolveResponse(res); //common response handler
                if (res && res.data) {
                    this.setState({ categoryList: res.data })
                }
            });

    }
    render() {
        return (
            <React.Fragment>
                <HeaderNavbar />

                <Grid direction="row" container className="flexGrow" spacing={1} style={{ paddingLeft: "10px", paddingRight: "10px" }}>
                    {this.state.categoryList && this.state.categoryList.map((row) => (
                        <Grid item xs={12} sm={4}>

                            <img src="https://winaero.com/blog/wp-content/uploads/2019/11/Photos-new-icon.png" />
                             {row}
                            <Button variant="contained" color="secondry" onClick={() => this.addProduct()}>
                                Add Pack
                            </Button>

                        </Grid>

                    ))}




                </Grid>


            </React.Fragment>
        );
    }
}

export default Homepage;
